import React from "react"
import './App.css';
import infologo from './images/logo-graphic.png';
import linkedin from './images/linkedin.jpeg';
import github from './images/github.jpg';
import devpost from './images/devpost.png';

function Home(props) {
  return (
    <div className="outer" >
      <div className="intro-left">
        <h4>Welcome!</h4>
        <h1>I'm Tanveer Brar, a second year Software Engineering student</h1>
        <p>I am interested in gaining experience with web development. This is my website featuring my skills and passion projects!</p>
      </div>
      <div className="intro-right">
        <img src={infologo} alt="graphic logo"/>
      </div>
      <div class="folbody">
        <p>
          Feel free to hover over to different parts of the website to view my projects and skills.
        </p>
        <p>
          Here're some of my social links:
          <a href="https://www.linkedin.com/in/brart5/"><img src={linkedin} alt="linkedin-placeholder"/></a>
          <a href="https://github.com/tbrar06"><img src={github} alt="github-placeholder"/></a>
        </p>
      </div>
    </div>
  )
}

export default Home;
